#include <iostream>
#include <string.h>
#include <algorithm>
#define ericxiao ios_base::sync_with_stdio(0);cin.tie(0);cout.tie(0);
using namespace std;

string fibs[100000];

string A = "1", B = "1", C;


int fbs[41];

string operator+(string a, string b){
    if(a.length() > b.length()) swap(a, b);
    while(a.length() < b.length()) a = '0' + a;
    reverse(a.begin(), a.end());
    reverse(b.begin(), b.end());
    string rs = "";
    bool carry = false;
    for(int i = 0; i < a.length(); i++){
        if(a[i] + b[i] + carry - 2 * '0' >= 10){
            rs += (char)(a[i] + b[i] + carry -  '0' - 10);
            carry = true;
        } else{
            rs += (char)(a[i] + b[i] + carry -  '0');
            carry = false;
        }
    }
    if(carry) rs += '1';
    reverse(rs.begin(), rs.end());
    return rs;
}

